{% load static %}
<!DOCTYPE html>
<html>
<head>
	<title>
		{% block title %}{% endblock %}
	</title>
  <meta charset="UTF-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  {% comment %} <script src="{% static 'js/main.js' %}" type="text/javascript"></script> {% endcomment %}
  <script src="{% static 'js/jquery-3.4.1.min.js' %}"></script>
  <script src="{% static 'js/jquery-3.4.1.js' %}"></script>
  <link rel="stylesheet" href="{% static 'js/script.js' %}">
  {% comment %} <link rel="stylesheet" href="{% static 'js/main.js' %}"> {% endcomment %}
  <link rel="stylesheet" href="{% static 'js/jquery-3.4.1.min.js' %}">
  <link rel="stylesheet" href="{% static 'js/jquery-3.4.1.js' %}">
  <link rel="stylesheet" href="{% static 'css/main.min.css' %}" />
  <link rel="stylesheet" href="{% static 'css/style.min.css' %}" />
  <link rel="stylesheet" href="{% static 'css/style.min.css' %}" />
  <link rel="stylesheet" media="screen" href="{% static 'css/main.css' %}" />
  {% comment %} <link rel="stylesheet"
  href="https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0/css/bootstrap.min.css"
  integrity="sha384-Gn5384xqQ1aoWXA+058RXPxPg6fy4IWvTNh0E263XmFcJlSAwiGgFAW/dAiS6JXm"
  crossorigin="anonymous"> {% endcomment %}

</head>
<body>
{% block base %}

    {% comment %} <script src="{% static 'js/main.js' %}" type="text/javascript"></script>
    <script src="{% static 'js/jquery-3.4.1.min.js' %}"></script>
    <script src="{% static 'js/jquery-3.4.1.js' %}"></script> {% endcomment %}
{% endblock %}
    <link rel="stylesheet" href="http://code.jquery.com/ui/1.8.18/themes/base/jquery-ui.css" type="text/css" media="all" /> 
    <script src="http://ajax.googleapis.com/ajax/libs/jquery/1.7.1/jquery.min.js" type="text/javascript"> </script> 
    <script src="https://ajax.googleapis.com/ajax/libs/jqueryui/1.8.16/jquery-ui.min.js" type="text/javascript"></script>

	  <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
		<script src="{% static 'js/libs.min.js' %}"></script>
		<script src="{% static 'js/script.js' %}"></script>
    {% comment %} <script src="{% static 'js/main.js' %}" type="text/javascript"></script> {% endcomment %}
    <script src="{% static 'js/jquery-3.4.1.min.js' %}"></script>
    <script src="{% static 'js/jquery-3.4.1.js' %}"></script>
    
</body>
</html>
